def min_operations_to_convert_binary_strings(S, T):
    n = len(S)
    m = len(T)
    if m <= n:
        return -1
    diff = m - n
    mn = float('inf')
    for i in range(diff + 1):
        seq = []
        if i != 0:
            seq.append(i - 1)
        else:
            seq.append(float('-inf'))
        for j in range(n):
            if S[j] != T[j + i]:
                seq.append(j + i)
        if diff - i != 0:
            seq.append(n + i)
        else:
            seq.append(float('inf'))
        if len(seq) == 2:
            return diff
        dp = [[float('inf'), float('inf')] for _ in range(len(seq) + 4)]
        dp[0][0] = 0
        dp[0][1] = 0
        j = 1
        while j < len(seq) - 1:
            dp[j][0] = min(dp[j][0], dp[j - 1][1] + seq[j] - seq[j - 1])
            dp[j][1] = dp[j - 1][0]
            j += 1
        mn = min(mn, diff + dp[len(seq) - 2][0], diff + dp[len(seq) - 2][1] + seq[len(seq) - 1] - seq[len(seq) - 2])
    if mn == float('inf'):
        return -1
    return mn

